        public static byte[] Decrypt(string encryptedText, string key)
        {
            byte[] buffer1 = Convert.FromBase64String(encryptedText);
            using (AesManaged aesManaged = new AesManaged())
            {
                using (SHA256CryptoServiceProvider cryptoServiceProvider = new SHA256CryptoServiceProvider())
                {
                    byte[] hash = cryptoServiceProvider.ComputeHash(Encoding.UTF8.GetBytes(key));
                    aesManaged.KeySize = 256;
                    aesManaged.BlockSize = 128;
                    aesManaged.Key = ((IEnumerable<byte>)hash).Take<byte>(aesManaged.KeySize / 8).ToArray<byte>();
                    aesManaged.IV = ((IEnumerable<byte>)hash).Take<byte>(aesManaged.BlockSize / 8).ToArray<byte>();
                    aesManaged.Mode = CipherMode.CBC;
                    byte[] array;
                    using (MemoryStream memoryStream1 = new MemoryStream(buffer1))
                    {
                        using (CryptoStream cryptoStream = new CryptoStream((Stream)memoryStream1,
                                   aesManaged.CreateDecryptor(), CryptoStreamMode.Read))
                        {
                            using (MemoryStream memoryStream2 = new MemoryStream())
                            {
                                byte[] buffer2 = new byte[1024];
                                int count;
                                while ((count = cryptoStream.Read(buffer2, 0, buffer2.Length)) > 0)
                                    memoryStream2.Write(buffer2, 0, count);
                                array = memoryStream2.ToArray();
                            }
                        }
                    }

                    return array;
                }
            }
        }

        public static byte[] Decompress(byte[] compressedData)
        {
            using (MemoryStream memoryStream = new MemoryStream(compressedData))
            {
                using (MemoryStream destination = new MemoryStream())
                {
                    using (GZipStream gzipStream = new GZipStream((Stream)memoryStream, CompressionMode.Decompress))
                        gzipStream.CopyTo((Stream)destination);
                    return destination.ToArray();
                }
            }
        }
